import React from 'react';

import './footer.css';

const Footer = () => {
  return (
    <div className="footer">
      <h3 className='footer-text'>
        <a href="/">
          This app is created in educational purpose.
        </a>
      </h3>
    </div>
  );
};

export default Footer;
